interface Props {
  onClick: () => void
  score: number
}

const Overlay: React.FC<Props> = ({onClick, score}) => {
  return (
    <div className="overlay">
    <div className="overlay-content">
      <p>Game over! Your score is {score}.</p>
      <button onClick={onClick}>Play Again</button>
    </div>
  </div>
  )
}

export default Overlay
